import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import NavBar from './containers/NavBar';

const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" render={() => (<NavBar />)}/>
        <Route path="/login" render={() => ("Login!")}/>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
